import React from 'react';
import Navbar from './Navbar';
import Corpo from './Corpo';
import './App.css';

const App = () => {
    return (
        <>
            <div className='teste'>
                <Navbar />
            </div>
            <div>
                <Corpo />
            </div>
        </>
    );
}

export default App;
